Эспандер "Бабочка".
Код:  2133
Цена:  305грн. «Бабочка» является отличным средством для начала работы над мышцами бедер
Это устройство нельзя считать полноценной заменой всех тренажеров, так как в основном прорабатываются только некоторые группы мышц;
Он достаточно легкий, не занимает много места;
Дешевый, поэтому купить может каждый;
Обычные очень часто ломаются, а профессиональные достаточно дорогие;
Упражнения для рук и груди неудобно выполнять, могут быть болезненные ощущения, мозоли или сдавливания на коже.
Нет возможности сменить нагрузку, а значит, со временем нужно переходить на другой снаряд.
Эспандер «Бабочка» состоит из центральной части «головки», в которой находится пружина, и двух полукружных рычагов, которые раздвинуты в разные стороны. Сверху они покрыты прорезиненным материалом, предотвращающим скольжение, а также травмированье  кожи во время тренировки. При приближении рычагов друг к другу происходит сжатие пружины (т.е. ее упругая деформация), и она в ответ на это усилие разжимается, с возвращением рычагов в исходное положение.

Эспандер Бабочка работает на сжатие и позволяет проработать практически все группы мышц, которые работают на сокращение, включая грудные мышцы, бицепс бедра, плечи, руки, пресс и даже трицепс и верхнюю часть спины.

Доставка в любой город Украины!
Доставка: Нова Почта. (1-3 дня) Без задержек !!!
